import 'package:flutter/material.dart';

class NavBarItem extends StatelessWidget {
  final String label;

  const NavBarItem({super.key, required this.label});

  @override
  Widget build(BuildContext context) {
    return TextButton(
      onPressed: () {},
      child: Text(
        label,
        style: const TextStyle(color: Colors.white),
      ),
    );
  }
}
